  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;rntCandidate hydrazine alternatives
  have been developed for spacecraft propulsion. The U.S. Air Force AF-M315E and the
  Swedish ammonium dinitramide propellants have received the most attention, while
  ammonium dinitramide propellants are a possible contender. While greenness relates
  to environmentally benign and relative toxicity, neither of these propellants is
  completely &amp;ldquo;nontoxic&amp;rdquo; or completely safe; if their energetic
  nature was not inherent they would not be used as monopropellants. This is particularly
  important with ammonium dinitramide (ADN) and hydrazinum nitroformate (HNF) propellants,
  which ESA and the EU has favored while the U.S. Air Force has focused on AF-M315E
  and the U.S. Army has investigated hydroxylammonium nitrate/triethanolammonium nitrate
  (HAN/TEAN; XM-46) propellants.&amp;nbsp; The first phase of the project&amp;rsquo;s
  focus will be to evaluate detection and decontamination methods for these propellants.&amp;nbsp;
  The second phase examined candidate materials for use in AF-M315E propulsion systems.
  Pairs of representative alloys, passivated and native, were immersed in AF-M315E
  at 71 &amp;deg;C for 31 d, fluid samples were periodically characterized and post-test
  materials and fluids were finally characterized. Typical corrosion studies use only
  the total time of immersion; this study also obtained interim data points.&lt;/p&gt;rn\",\n\t\"license_title\":
